import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about-container">
      <header>
        <h1>About Us</h1>
        <p>A brief description of your company or business</p>
      </header>
      <section className="photo-gallery">
        <img src="../assets/giacche.jpg" alt="team member 1" />
        <img src="../assets/giacche.jpg" alt="team member 2" />
        <img src="../assets/giacche.jpg" alt="team member 3" />
        {/* add more images as needed */}
      </section>
      <section className="text-section">
        <h2>Our Story</h2>
        <p>More information about your company or business</p>
      </section>
      <div className="social-icons">
        <a href="https://www.facebook.com"><i className="fa fa-facebook"></i></a>
        <a href="https://www.twitter.com"><i className="fa fa-twitter"></i></a>
        <a href="https://www.instagram.com"><i className="fa fa-instagram"></i></a>
        {/* add more social media icons as needed */}
      </div>
    </div>
  );
}

export default About;
